    reg3=reg4+reg3; reg6=reg6-reg2; reg2=reg1+reg2; reg5=reg0+reg5; reg0=reg3-reg0;
    reg2=reg0*reg2; reg5=reg6*reg5; T det_jac=reg2-reg5;

